output.code:
function output(obj, RPC) {

	if(!obj) return;

	let o = {};

	let prop = obj[`d:propstat`][`d:prop`];

	if(RPC) {
		if(RPC === 'RPC-File') {
			o.file = iml.if(prop[`d:getcontenttype`], true, false);
			o.label = iml.decodeURL(iml.replace(iml.if(prop[`d:quota-available-bytes`], obj[`d:href`].substring(0, iml.length(obj[`d:href`]) - 1), obj[`d:href`]) , '/.*\/([^/]+)$/', '$1'));
			o.value = iml.decodeURL(iml.replace(iml.if(prop[`d:quota-available-bytes`], obj[`d:href`].substring(0, iml.length(obj[`d:href`]) - 1), obj[`d:href`]) , '/.*\/([^/]+)$/', '$1'));
		}
		else {
			o.label = iml.decodeURL(iml.replace(obj[`d:href`].substring(0, iml.length(obj[`d:href`]) - 1) , '/.*\/([^/]+)$/', '$1'));
			o.value = iml.decodeURL(iml.replace(obj[`d:href`].substring(0, iml.length(obj[`d:href`]) - 1) , '/.*\/([^/]+)$/', '$1'));
		}
	}

	else {
		o.name = iml.decodeURL(iml.replace(iml.if(prop[`d:quota-available-bytes`], obj[`d:href`].substring(0, iml.length(obj[`d:href`]) - 1), obj[`d:href`]) , '/.*\/([^/]+)$/', '$1'));
		o.lastModified = iml.parseDate(prop[`d:getlastmodified`], 'ddd, DD MMM YYYY HH:mm:ss', 'UTC');
		o.contentLength = prop[`d:getcontentlength`];
		o.resourceType = prop[`d:resourcetype`];
		o.quotaUsedBytes = prop[`d:quota-used-bytes`];
		o.quotaAvailableBytes = prop[`d:quota-available-bytes`];
		o.eTag = prop[`d:getetag`].substring(1, iml.length(prop[`d:getetag`]) - 1);
		o.contentType = prop[`d:getcontenttype`];
	}

	return o;

}

generalResponse.code:
function generalResponse(obj) {

    if(!obj) return;

    else if (Array.isArray(obj)) {
        obj.shift();
        obj.forEach(item => {
            item = iml.generalResponse(item);
        });
    }

    else if (typeof obj === 'object') {
        for (let [key, value] of Object.entries(obj)) {
            if (Array.isArray(value)) {
                obj[key] = value[0];

                if(typeof obj[key] === 'object') {
                    obj[key] = iml.generalResponse(obj[key]);
                }
            }
        }
    }



    return obj;

}
